import React, { useState } from 'react';
import './bills.css'

const Bills = () => {
  const [bills, setBills] = useState([]);
  const [selectedBillName, setSelectedBillName] = useState('');
  const [billAmount, setBillAmount] = useState('');
  const [dueDate, setDueDate] = useState('');
  const [additionalInfo, setAdditionalInfo] = useState('');

  const predefinedBillNames = [
    'Electricity',
    'Internet',
    'Phone',
    'Rent',
    'Credit Card',
  ];

  const handleAddBill = (e) => {
    e.preventDefault();
    const newBill = {
      billName: selectedBillName,
      billAmount,
      dueDate,
      additionalInfo,
    };
    setBills([...bills, newBill]);
    setSelectedBillName('');
    setBillAmount('');
    setDueDate('');
    setAdditionalInfo('');
  };


  return (
    <div className="bill-content">
      <div className="bill">
        <h2>Manage Bills</h2>
        <form className="manage-bill" onSubmit={handleAddBill} >
          <div>
            <div className="bill-name">
              {/* <label>Bill Name:</label> */}
              <select
                value={selectedBillName}
                onChange={(e) => setSelectedBillName(e.target.value)}
                required
              >
                <option value="" disabled>
                  Select a bill
                </option>
                {predefinedBillNames.map((billName, index) => (
                  <option key={index} value={billName}>
                    {billName}
                  </option>
                ))}

              </select>
            </div>
              {selectedBillName === 'Electricity' && (
                <div className="bill-name">
                  {/* <label>Bill Number:</label> */}
                  <input
                    type="text"
                    value={additionalInfo}
                    onChange={(e) => setAdditionalInfo(e.target.value)}
                    required
                  />
                </div>
              )}
              {selectedBillName === 'Internet' && (
                <div className="bill-name">
                  <label>DLS Number:</label>
                  <input
                    type="text"
                    value={additionalInfo}
                    onChange={(e) => setAdditionalInfo(e.target.value)}
                    required
                  />
                </div>
              )}
              {selectedBillName === 'Phone' && (
                <div className="bill-name">
                  <label>Phone Number:</label>
                  <input
                    type="text"
                    value={additionalInfo}
                    onChange={(e) => setAdditionalInfo(e.target.value)}
                    maxLength={10}
                    required
                  />
                </div>
              )}
              {selectedBillName === 'Rent' && (
                <div className="bill-name">
                  <label>Month:</label>
                  <input
                    type="month"
                    value={additionalInfo}
                    onChange={(e) => setAdditionalInfo(e.target.value)}
                    required
                  />
                </div>
              )}
              {selectedBillName === 'Credit Card' && (
                <div className="bill-name">
                  <label>Card Number:</label>
                  <input
                    type="text"
                    value={additionalInfo}
                    onChange={(e) => setAdditionalInfo(e.target.value)}
                    maxLength={16}
                    required
                  />
                </div>
              )}
          </div>
          <div className="bill-name">
            <label>Bill Amount:</label>
            <input
              type="number"
              value={billAmount}
              onChange={(e) => setBillAmount(e.target.value)}
              required
            />
          </div>
          <div className="bill-name">
            <label>Due Date:</label>
            <input
              type="date"
              value={dueDate}
              onChange={(e) => setDueDate(e.target.value)}
              required
            />
          </div>

          <button className="add-bill" type="submit">Add Bill</button>
        </form>
      </div>
    </div>
  )
}

export default Bills;
